#define MAXN 100

char grid[MAXN][MAXN];
int n,m;
int dx[] = {-1,0,0,1};
int dy[] = {0,-1,1,0};

bool is_valid(int x, int y) {
    return x >= 0 && x < n && y >= 0 && y < m && grid[x][y]!= 'X';
}

int bfs(int sx, int sy, int fx, int fy) {
    bool visited[MAXN][MAXN];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            visited[i][j] = false;
        }
    }
    queue<pair<int, int>> q;
    q.push({sx,sy});
    visited[sx][sy] = true;
    int len = 0;
    while (!q.empty()) {
        int x = q.front().first;
        int y = q.front().second;
        q.pop();
        if (x == fx && y == fy) {
            return len;
        }
        for (int i = 0; i < 4; i++) {
            int nx = x + dx[i];
            int ny = y + dy[i];
            if (is_valid(nx,ny) &&!visited[nx][ny]) {
                q.push({nx,ny});
                visited[nx][ny] = true;
            }
        }
        len++;
    }
    return -1;
}

string path(int sx, int sy, int fx, int fy) {
    bool visited[MAXN][MAXN];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            visited[i][j] = false;
        }
    }
    queue<pair<int, int>> q;
    q.push({sx,sy});
    visited[sx][sy] = true;
    string ans = "";
    while (!q.empty()) {
        int x = q.front().first;
        int y = q.front().second;
        q.pop();
        if (x == fx && y == fy) {
            return ans;
        }
        for (int i = 0; i < 4; i++) {
            int nx = x + dx[i];
            int ny = y + dy[i];
            if (is_valid(nx,ny) &&!visited[nx][ny]) {
                q.push({nx,ny});
                visited[nx][ny] = true;
                if (i == 0) ans += "up";
                if (i == 1) ans += "right";
                if (i == 2) ans += "down";
                if (i == 3) ans += "left";
            }
        }
    }
    return "";
}

int main() {
    string s;
    getline(cin,s);
    n = s.length();
    for (int i = 0; i < n; i++) {
        getline(cin,s);
        m = s.length();
        for (int j = 0; j < m; j++) {
            grid[i][j] = s[j];
        }
    }
    int sx = 0, sy = 0, fx = 0, fy = 0;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {
            if (grid[i][j] == '*') {
                sx = i;
                sy = j;
            }
            if (grid[i][j] == '#') {
                fx = i;
                fy = j;
            }
        }
    }
    int len = bfs(sx,sy,fx,fy);
    if (len == -1) {
        cout << "infeasible" << endl;
    } else {
        cout << path(sx,sy,fx,fy) << endl;
    }
}

